import { Component } from "react";
import ButtonBlur from "./ButtonBlur";
import "./Navbar.css";
import logo from './assets/logo.png';

class Navbar extends Component{
    render(){
        return <div className="Navbar">
            <div className="logo-nav">
                <img src={logo} />
            </div>
            <ButtonBlur/>
        </div>
    }
}

export default Navbar;
